    let intersection_index = loc_code.indexOf(code);
    let location_code = loc_code[intersection_index];
    let location_x = loc_X[intersection_index];
    let location_y = loc_Y[intersection_index];
    let loc_1 = level_1[intersection_index];
    let loc_2 = level_2[intersection_index];
    let loc_3 = level_3[intersection_index];
    console.log(`${location_code} ${location_x} ${location_y} ${loc_1} ${loc_2} ${loc_3}`);
