export async function get_info(content){
    async function get_index(arr, search) {
        const result = arr.reduce((acc, curr, index) => {
            if (curr.includes(search)) {
                acc.push(index);
            }
            return acc;
        }, []);
        return result;
    }
    var contentArr = content.split(" ");
    var idx_to_delete = await get_index(contentArr, '날씨');
    delete contentArr[idx_to_delete];
    var contentArr = contentArr.filter((x) => x !== undefined);

    var a = contentArr[0];
    var b = contentArr[1];
    var c = contentArr[2];

    if(a){
        var loc_level_1 = await get_index(level_1, a);
        if(loc_level_1.length==0){
            var loc_level_2 = await get_index(level_2, a);
            if(loc_level_2.length==0){
                var loc_level_3 = await get_index(level_3, a);
                if(loc_level_3.length==0){
                    return "CANNOT_FIND";
                } else {
                    loc_level_1 = loc_level_3;
                    loc_level_2 = loc_level_3;
                }
            } else {
                loc_level_3 = await get_index(level_3, b);
                if(loc_level_3.length==0){
                    loc_level_3 = await get_index(level_3, c);
                    if(loc_level_3.length==0){
                        loc_level_1 = loc_level_2;
                        loc_level_3 = loc_level_2; 
                    }
                } else {
                    loc_level_1 = loc_level_2;
                }
            }
        } else {
            loc_level_2 = await get_index(level_2, b);
            if(loc_level_2.length==0){
                loc_level_2 = await get_index(level_2, c);
                if(loc_level_2.length==0){
                    loc_level_3 = await get_index(level_3, b);
                    if(loc_level_3.length==0){
                        loc_level_2 = loc_level_1;
                        loc_level_3 = loc_level_1;
                    } else {
                        loc_level_2 = loc_level_3;
                    }
                } else {
                    loc_level_3 = loc_level_2;
                }
            } else {
                loc_level_3 = await get_index(level_3, c);
                if(loc_level_3.length==0){
                    loc_level_3 = loc_level_2;
                }
            }
        }
    } else {
        return "Nah";
    }

    // console.log(`level_1 : ${loc_level_1}\n level_2 : ${loc_level_2}\nlevel_3 : ${loc_level_3}`);
    let intersect = loc_level_1.filter(x => loc_level_2.includes(x));
    let intersection = intersect.filter(x => loc_level_3.includes(x));
    var intersection_index = intersection[0];
    var location_code = loc_code[intersection_index];
    var location_x = loc_X[intersection_index];
    var location_y = loc_Y[intersection_index];
    var loc_1 = level_1[intersection_index];
    var loc_2 = level_2[intersection_index];
    var loc_3 = level_3[intersection_index];
    return (`${location_code} ${location_x} ${location_y} ${loc_1} ${loc_2} ${loc_3}`);
}